import React from "react";
import '../App.css';
import $ from 'jquery';
import { Button } from "@material-ui/core";

export default function Home(){
    
    (function () {
        const second = 1000,
              minute = second * 60,
              hour = minute * 60,
              day = hour * 24;
      
        //I'm adding this section so I don't have to keep updating this pen every year :-)
        //remove this if you don't need it
        // let today = new Date(),
        //     dd = String(today.getDate()).padStart(2, "0"),
        //     mm = String(today.getMonth() + 1).padStart(2, "0"),
        //     yyyy = today.getFullYear(),
        //     nextYear = yyyy + 1,
        //     dayMonth = "09/30/",
        //     birthday = dayMonth + yyyy;
        
        // today = mm + "/" + dd + "/" + yyyy;
        // if (today > birthday) {
        //   birthday = dayMonth + nextYear;
        // }
        //end
        
        const countDown = new Date("Dec 21, 2021 19:37:25").getTime(),
            x = setInterval(function() {    
      
              const now = new Date().getTime(),
                    distance = countDown - now;
      
              document.getElementById("days").innerText = Math.floor(distance / (day)),
                document.getElementById("hours").innerText = Math.floor((distance % (day)) / (hour)),
                document.getElementById("minutes").innerText = Math.floor((distance % (hour)) / (minute)),
                document.getElementById("seconds").innerText = Math.floor((distance % (minute)) / second);
      
              //do something later when date is reached
              if (distance < 0) {
                document.getElementById("countdown").style.display = "none";
                document.getElementById("content").style.display = "block";
                clearInterval(x);
              }
              //seconds
            }, 0)
        }());

        var ml4 = {};
ml4.opacityIn = [0,1];
ml4.scaleIn = [0.2, 1];
ml4.scaleOut = 3;
ml4.durationIn = 800;
ml4.durationOut = 600;
ml4.delay = 500;

anime.timeline({loop: true})
  .add({
    targets: '.ml4 .letters-1',
    opacity: ml4.opacityIn,
    scale: ml4.scaleIn,
    duration: ml4.durationIn
  }).add({
    targets: '.ml4 .letters-1',
    opacity: 0,
    scale: ml4.scaleOut,
    duration: ml4.durationOut,
    easing: "easeInExpo",
    delay: ml4.delay
  }).add({
    targets: '.ml4 .letters-2',
    opacity: ml4.opacityIn,
    scale: ml4.scaleIn,
    duration: ml4.durationIn
  }).add({
    targets: '.ml4 .letters-2',
    opacity: 0,
    scale: ml4.scaleOut,
    duration: ml4.durationOut,
    easing: "easeInExpo",
    delay: ml4.delay
  }).add({
    targets: '.ml4 .letters-3',
    opacity: ml4.opacityIn,
    scale: ml4.scaleIn,
    duration: ml4.durationIn
  }).add({
    targets: '.ml4 .letters-3',
    opacity: 0,
    scale: ml4.scaleOut,
    duration: ml4.durationOut,
    easing: "easeInExpo",
    delay: ml4.delay
  }).add({
    targets: '.ml4',
    opacity: 0,
    duration: 500,
    delay: 500
  });

return (
    
    <div class="container">
    <h1 className="mainHeading">HOLA MOZILLA 2.0</h1>
    <div className="dateText"><span>21</span><span>st</span> <span>December @ 7.00pm</span></div>
   
   

  <div id="countdown">
    <ul>
      <li><span id="days"></span><tx>days</tx></li>
      <li><span id="hours"></span><tx>Hours</tx></li>
      <li><span id="minutes"></span><tx>Minutes</tx></li>
      <li><span id="seconds"></span><tx>Seconds</tx></li>
    </ul>
  </div>

  {/* <img className="watermark" src="https://res.cloudinary.com/fitness-glory/image/upload/v1639484985/logo_icon-01_s6oex8.png"/> */}

  <Button
          className="myBtn"
        >
          <a style={{ textDecoration: "none" }} >
            Register Now
          </a>
        </Button>

<h1 className="ml4">
  <span class="letters letters-1">Ready</span>
  <span class="letters letters-2">Set</span>
  <span class="letters letters-3">Go!</span>
</h1>
</div>
)
}
